import React from 'react';
import { Link } from 'react-router-dom';
import { withRouter } from "react-router";
import AuthOptions from './AuthOptions';

export default function Navbar(props) {

    const state = {
        showCollapsedMenu: false
    }
    const toggleMenu = () => {
        this.setState({
          showCollapsedMenu: !this.state.showCollapsedMenu
        })
    }

    const show = (this.state.showCollapsedMenu) ? "show" : "" ;


    return (
        // <nav class="navbar navbar-expand-lg">
        //     <Link to="/home" class="navbar-brand">Wish Upon a Star</Link>
        //     <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        //         <span class="navbar-toggler-icon"></span>
        //     </button>
        //     <div class="collpase navbar-collapse" id="navbarNav">
        //         <ul class="navbar-nav nav-pills ml-auto">
        //             <AuthOptions />
        //         </ul>
        //     </div>
        // </nav>

        <nav class="navbar navbar-expand-lg">
            <Link to="/home" class="navbar-brand">Wish Upon a Star</Link>
            <button class="navbar-toggler custom-toggler" onClick={toggleMenu()} type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class={"collapse navbar-collapse" + show} id="navbarNav">
                <ul class="navbar-nav nav-pills ml-auto">
                    <AuthOptions />
                </ul>
            </div>
        </nav>



        // <nav id="navbar">
        //     <Link to="/home"><h1 className= "title">Wish-Upon</h1></Link> 
        //     <AuthOptions />
        // </nav>
    )
}

